import React from 'react'

function NavBar() {
  return (
    <nav style={{ backgroundColor: "black", padding: "8px 12px" }}>
      <ul style={{ listStyle: "none", color: "white", display: "flex", justifyContent:"space-between" }}>
        <li>Home</li>
        <li style={{ color: "purple" }}>About</li>
        <li>Contact</li>
      </ul>
    </nav>
  )
}

export default NavBar;
